create table wksp_frongpmstdev.prt_organizations (
    organization_id   number
        generated by default on null as identity minvalue 1 maxvalue 9999999999999999999999999999 increment by 1 start with 1 cache 20
        noorder nocycle nokeep noscale
    not null enable,
    organization_name varchar2(1000 byte) not null enable,
    organization_type varchar2(100 byte) not null enable,
    description       varchar2(1000 byte),
    enabled_flag      varchar2(1 byte) not null enable,
    end_date_active   date,
    dff_n1            number,
    dff_n2            number,
    dff_n3            number,
    dff_n4            number,
    dff_n5            number,
    dff_v1            varchar2(240 byte),
    dff_v2            varchar2(240 byte),
    dff_v3            varchar2(240 byte),
    dff_v4            varchar2(240 byte),
    dff_v5            varchar2(240 byte),
    dff_d1            date,
    dff_d2            date,
    creation_date     timestamp(6) with local time zone not null enable,
    created_by        varchar2(100 byte) not null enable,
    last_update_date  timestamp(6) with local time zone not null enable,
    last_updated_by   varchar2(100 byte) not null enable
);

alter table wksp_frongpmstdev.prt_organizations
    add constraint prt_organizations_pk primary key ( organization_id )
        using index enable;


